export function logoutSuccsess(){
  return {
    type: 'LOGOUT_SUCCESS'
  }
}

export function logout(url){
  return (dispatch)=>{
    fetch(url,  {method: 'GET'})
      .then(response =>{
        if(!response.ok){
          throw new Error(response.statusText)
        }
        return response;
      })
      .then(response=> response.json())
      .then(data => dispatch(logoutSuccsess()))
  }
}
